import React from 'react';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'
import App from './App';
import Wizard from './Wizard';

const routing = (
    <Router>
      <div>
        <Route path="/" component={App} />
        <Route path="/Wizard" component={Wizard} />
      </div>
    </Router>
  )
  
